/** @format */

import React from "react";
const Navbar = () => {
  return (
    <>
      <div className="container Navbar">
        <div className="row">
          <div className="col-6 logoo">
            <h1>UsmanKhalid</h1>
          </div>
          <div className="col-6 Navlinks float-right">
            <ul>
              <li>
                <a href="facebook.com">Home</a>
              </li>
              <li>
                <a href="facebook.com">Services</a>
              </li>
              <li>
                <a href="facebook.com">About</a>
              </li>
              <li>
                <a href="facebook.com">Contact</a>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};

const Comman = () => {
  return (
    <>
      <Navbar />
    </>
  );
};
export default Comman;
